// src/components/CircularSidebar.js
import React from 'react';
import '../../styles/CircularSidebar.css';

const CircularSidebar = () => {
  return (
    <div className='circul'>
    <div className="circular-sidebar">
      <div className="circle">
        <ul>
          <li><a href="#intro" className="circle-button">Intro</a></li>
          <li><a href="#lessons" className="circle-button">Lessons</a></li>
          <li><a href="#quiz" className="circle-button">Quiz</a></li>
          <li><a href="#login" className="circle-button">Login</a></li>
          <li><a href="#register" className="circle-button">Register</a></li>
        </ul>
      </div>
    </div>
    </div>
  );
};

export default CircularSidebar;
